import React from "react";
import CountdownTimer from "../components/CountdownTimer";

export default function Wikirace() {
  return (
    <div>
      <h1 style={{ color: "red" }}>Wikirace</h1>
      <CountdownTimer duration={10 * 1000} />   // 7 * 60 * 1000 for 7 minutes
    </div>
  );
}
